INSERT INTO `log_table` (`log_id`, `user_id`, `task_id`, `work_hours`, `log_time`, `description`) VALUES
(1, 1, 55, 1.5, '2012-10-31 20:04:12', 'Added the log entry form to the task form page; testing the form now.'),
(3, 1, 55, 0.5, '2012-10-31 20:27:13', 'Added a list of work log entries (max 10 most recent) to the end of the task form page.'),
(4, 1, 55, 0, '2012-10-31 20:32:11', 'Made the work hours optional.'),
(5, 1, 55, 0.5, '2012-10-31 21:54:32', 'Styled the work log in the task form page.'),
(6, 4, 57, 4, '2012-11-02 18:16:56', 'Design questions - how to find the shares on the drive before the share has been mounted?  The File System library has been deprecated in 10.8 in favor of NSURL.'),
(7, 4, 57, 4, '2012-11-02 20:31:12', 'Trying to get information about a volume from the AFP URL.  Doesn''t seem to be a way right now.  Probably need to mount it.  Can we mount without a share name?'),
(8, 1, 55, 2, '2012-11-02 22:45:13', 'Some refactoring and restyling of the log page'),
(9, 4, 57, 4, '2012-11-05 16:58:44', 'Found out how to determine the name of the share on the volume.  Adam says the T4 and T8 will never ship with more than one.  However ... odd problems with connection to the T4.  Adam is helping with them.'),
(10, 4, 57, 3.5, '2012-11-05 20:25:44', 'Code is complete, slightly tested on a T4; not tested at all on a T8 or T16.'),
(11, 1, 58, 3, '2012-11-05 21:56:10', 'Created a stub page as a template for php files;  added a function prepare_page_data() to the template which is called after process_query_string() and process_form_data(), but before emitting the page contents.'),
(12, 1, 58, 0.5, '2012-11-05 22:11:57', 'Implemented process_page_data in project.php'),
(13, 1, 58, 0.25, '2012-11-05 22:15:39', 'Implemented process_page_data in projects.php'),
(14, 1, 58, 0.5, '2012-11-05 22:36:56', 'Implemented prepare_page_data in task.php; normalized the way database requests are handled.'),
(15, 1, 58, 0.25, '2012-11-05 22:45:08', 'Implemented prepare_page_data in timebox.php; normalized the way database requests are handled.'),
(16, 1, 58, 0, '2012-11-05 22:49:05', 'Implemented prepare_page_data in todo.php; normalized the way database requests are handled.'),
(18, 1, 48, 0.5, '2012-11-06 01:45:09', 'Done.'),
(19, 1, 48, 0.25, '2012-11-06 01:45:29', 'Done.'),
(20, 1, 44, 0, '2012-11-06 01:46:01', 'Done.'),
(21, 1, 55, 1, '2012-11-06 15:26:52', 'Added widths and margins to the float:right details elements.'),
(22, 4, 57, 3, '2012-11-06 16:24:56', 'Tested on the T8.'),
(23, 1, 65, 1.25, '2012-11-07 03:32:51', 'Done'),
(24, 4, 57, 4, '2012-11-06 22:37:25', 'Rebuilt and packaged ST-Wizard for release and distribution.  This is version 1.01 (1277).'),
(25, 1, 66, 1.5, '2012-11-07 16:29:47', 'Done.'),
(26, 4, 68, 6, '2012-11-07 20:48:09', 'Tracking down the root cause - see comment in Bugzilla'),
(27, 1, 82, 1.5, '2012-11-08 03:02:29', 'created common CSS classes in styles.css for headers for Project, Task, Timebox, and User types, and for lists of objects'),
(28, 1, 82, 0.5, '2012-11-08 14:16:45', 'Decided I didn''t like the background gradient on the header in the project.php, task.php, timebox.php, and user.php, so I took them back out again'),
(29, 4, 80, 5, '2012-11-08 20:11:44', 'Rebuilt the app install package, but it failed when I tested it.  Found out some of the files in the packager were wrong, so the package wasn''t build correctly.  Fixed it, check in the changes to the packager, and delivered to Adam and Chris.'),
(30, 1, 84, 2.5, '2012-11-08 22:59:35', 'Copied the files up, created database.  Need to figure out how to tell Apache to let Njia use mysql.'),
(31, 1, 90, 1.75, '2012-11-13 00:06:18', 'Implemented the page as users.php; moved ''create account'' form from user.php to users.php; added ''close this account'' and ''re-open this account'' to the user.php.'),
(32, 19, 91, 0.5, '2012-11-13 05:00:10', 'Divided the Basic Solo Principles into two slides'),
