(57, 12, NULL, 'Bug #136 - Mount multiple shares on the Titanium', 'Customer used ST-Wizard to configure his first Mac-Titanium connection.... \r\n\r\ndid some testing then did his IT duties, added usernames, changed volume/share name (they all do this!).... \r\n\r\nand of course subsequent Mac''s can not use the Wizard since "/Volumes/share1" does not exist.........', 4, NULL, 'open', '2012-11-02 14:31:28', '2012-11-07 23:36:32'),
(58, 8, NULL, 'Normalize page implementations', 'Go through all .php files and normalize the way $_GET parameters and $_POST parameters are handled, the way data is written to the database, and way the way data is read from the database.', 1, 13, 'open', '2012-11-05 21:53:14', '2012-11-30 20:47:57'),
