(67, 10, NULL, 'Bug #130 - Check sysctl.conf', 'It would be really great if the streams counter app would check our tuning values.  For example, if we had a sysctl.conf file we liked to use, and we put "#Small Tree" at the top, the tuning app could look for that.  I think this check would more correctly be in the streams counter app.\r\n\r\nThe Wizard is more of a startup wizard.  It has you walk through steps and plug in cables etc. It''s not quite as appropriate.', 4, 17, 'closed', '2012-11-07 16:35:47', '2012-12-04 20:08:33'),
(68, 10, NULL, 'Bug #133 - Streams counter fails when the volume name contains a space.', 'Traced this into dtrace.  Apparently we need to find a way to appropriately quote the file names before passing them to the dtrace scripts.', 4, 14, 'open', '2012-11-07 16:36:25', '2012-11-07 16:52:18'),
(69, 10, NULL, 'Bug #160 - more options to the drop down menu for "Traffic Profile"', 'Suggestion from Eric Hansen, 11/6/12:\r\n\r\nCould you add more options to the drop down menu for "Traffic Profile". now that apps like Premiere Pro work with native H.264 and REDRAW, among others, it might help to add more to the list.', 4, 17, 'closed', '2012-11-07 16:37:01', '2012-12-04 20:08:28'),
(70, 10, NULL, 'Bug #161 - Make test sizes 100MB, 500MB, 1GB and 2GB', 'Suggestion from Eric Hansen, 11/6/12:\r\n\r\nthe Test Size is in Bytes of 100M, 500M, 1000M and 2000M. it might make more sense to change them to 100MB, 500MB, 1GB and 2GB. none of my clients would know what 2000M Bytes is.', NULL, NULL, 'closed', '2012-11-07 16:37:43', '2012-11-21 18:52:46'),
(71, 10, 70, 'Bug 162 - "not sure what the Distribution and Sequence panels are telling me"', 'This should have been an independent task, not a subtask of #70;  created task #72 to replace it.\r\n\r\n----------\r\n\r\nSuggestion from Eric Hansen, 11/6/12:\r\n\r\ni can''t seem to find a manual, so i''m not sure what the Distribution and Sequence panels are telling me. what numbers are good and what numbers are bad? how do i know when i''ve hit too many streams for real-time playback?', 4, NULL, 'closed', '2012-11-07 16:38:23', '2012-11-07 23:36:32'),
(72, 10, NULL, 'Bug #162 - "not sure what the Distribution and Sequence panels are telling me"', 'Suggestion from Eric Hansen, 11/6/12:\r\n\r\ni can''t seem to find a manual, so i''m not sure what the Distribution and Sequence panels are telling me. what numbers are good and what numbers are bad? how do i know when i''ve hit too many streams for real-time playback?', NULL, NULL, 'open', '2012-11-07 16:39:16', '2012-11-07 16:52:37'),
(73, 12, NULL, 'Bug #132 - Offer to let the user select an interface instead of plugging in the server', 'Currently the wizard asks the user to connect the storage server to the workstation, and then automatically detects which interface comes up.\r\n\r\nThe wizard could show the user which interfaces are available on the workstation, and allow the user to specify which interface will be used, instead of detecting it by plugging in.', 4, NULL, 'open', '2012-11-07 16:41:18', '2012-11-07 23:36:32'),
(74, 12, NULL, 'Bug #142 - Add a "Verify" button', 'The Intro pane will have a "Verify" button which the user can select to simply verify a previous installation.  In this case, the System Check pane will list whether things are already correctly configured.  The user can click Continue to re-do the configuration, or simple exit.', 4, NULL, 'open', '2012-11-07 16:42:32', '2012-11-07 23:36:32'),
(75, 12, NULL, 'Bug #144 - Use ping + arp instead of just ping to discover the switch', 'Currently the wizard pings the addresses 192.168.x.220 for x from 0 to 7 to discover the IP address of the server.  The wizard sets its IP address to 192.168.1.1 and its netmask to 255.255.248.0 so all those addresses are in its subnet.  This works, but its not clear why, since the server''s netmask is 255.255.255.0, and only the 192.168.1.220 address will see the wizard''s address as being in its subnet.  This raises the concern that a future version of linux might not behave the same way, and this feature will break.\r\n\r\nA more robust alternative would be to ignore the response or non-response to the ping and check the ARP table after the ping.  The ping will need to do an ARP anyway to get the server''s ethernet address, and if the server responds to the ARP request, its IP address will show up in the ARP table.  Because ARP works at the link layer, the routing information is irrelevant.\r\n\r\nNote that the wizard will need to clear the 192.168.x.220 addresses from the ARP cache before the pings, so that there is no stale information to confuse it.', 4, NULL, 'open', '2012-11-07 16:43:05', '2012-11-07 23:36:32'),
(76, 12, NULL, 'Bug #145 - Replace FSMountServerVolumeSync with DADiskMount', 'The standard call FSMountServerVolumeSync is now deprecated.  The recommended way to mount/unmount a disk is now DADiskMount and DADiskEject, which are part of the Disk Arbitration Framework.\r\n\r\nSpecifically, FSMountServerVolumeSync is deprecated as of MacOS v10.8.', 4, NULL, 'open', '2012-11-07 16:44:22', '2012-11-07 23:36:32'),
(77, 12, NULL, 'Bug #158 - Provide link to Titanium admin web page', 'After the wizard has been run, the user wants to connect to the admin page of the Titanium to configure users, share, etc.\r\n\r\nWe can make this easy by providing a link in the wizard at the very end, after the wizard has been run.\r\n\r\nIt was suggested that we could also put a link on the user''s desktop.\r\n\r\nCons:  1) Everybody wants to put links on the user''s desktop, and this is annoying;  2) once the admin page is up, the user can easily put his own link on his desktop by dragging the URL icon.', 4, NULL, 'open', '2012-11-07 16:45:06', '2012-11-07 23:36:32'),
(78, 12, NULL, 'Bug #159 - Provide link to STC documentation on the company web page', 'Documentation is not currently packaged with the Titanium, but must be downloaded from the STC company web page.  We can simplify this for the user by providing a link to the web page in the wizard.', 4, NULL, 'open', '2012-11-07 16:45:57', '2012-11-07 23:36:32'),
