(89, 16, NULL, 'Review other camp web sites', 'Websites to review for ideas:\r\nhttp://drupalcampchicago.org/\r\nhttp://2012.badcamp.net/\r\nhttp://2012.drupalcampla.com/\r\nhttp://2012.drupalcorn.org/   (I''m from Iowa, I like the drupal corn kernal icon -- hee, hee)\r\nhttp://boston2012.design4drupal.org/\r\nhttps://www.drupalcampatlanta.com/\r\nhttp://colorado2011.camps.drupal.org/index.html\r\nhttp://portland2013.drupal.org/\r\n', 19, 19, 'open', '2012-11-12 16:37:52', '2012-11-12 16:38:53'),
