(92, 10, NULL, 'Debug performance issue', 'During the read phase of the streams test, the GUI display gets far behind the actual reads.  The activity monitor shows that the network activity ends long before the GUI shows that the reads have finished.\r\n\r\nRunning stctruss by itself shows no slowdown.  Watching the CPU shows that the GUI is only using about 5% of CPU while the reads are slow.  The kernel task may be up to 50% of CPU.\r\n\r\nOnly the read shows the slow-down.  The writes are fine.  However, only the reads use truss.  Theoretically, this should have no effect.\r\n\r\n---\r\n\r\nThe problem goes away when these two lines are commented out of [STC_RunTest updateDisplays]:\r\n\r\n    [app setStatusMessage:testMessage];\r\n    [app setProgress:progress];\r\n', 4, 14, 'open', '2012-11-20 14:34:44', '2012-11-20 21:07:06'),
